(6, 'Mint', 'Mentha (also known as mint, from Greek mintha, Linear )[3] is a genus of plants in the family Lamiaceae (mint family).The species are not clearly distinct, and estimates of their number vary from 13 to 18.', 7, 1, 'http://www.freemagebank.com/wp-content/uploads/edd/2015/07/CR000001LR.jpg'),
(7, 'Tulip', 'The tulip is a Eurasian and North African genus of perennial, bulbous plants in the lily family. It is an herbaceous herb with showy flowers, of which around 75 wild species are currently accepted.', 8, 1, 'https://pixabay.com/static/uploads/photo/2015/03/26/09/47/tulip-690320_960_720.jpg'),
(8, 'Mimusa pudica', 'Mimosa pudica is a creeping annual or perennial herb of the pea family Fabaceae often grown for its curiosity value: the compound leaves fold inward and droop when touched or shaken, defending themselves from harm, and re-open a few minutes later.', 10, 1, 'http://www.alsagarden.com/40-large_default/mimosa-pudica-plante-sensitive-graines.jpg'),
